import { React ,useEffect,useState} from 'react';
import axios from 'axios';
const Home = () => {
    const [Posts , setPosts] = useState([]);
    const apiEnd = 'https://jsonplaceholder.typicode.com/posts';

    useEffect(()=>{
        const getPosts = async () =>{
            const { data : res} =  await axios.get(apiEnd)
            setPosts(res)
        };
        getPosts();
    },[])
    return (

        <div className=''>
            <h2>there are {Posts.length}post in the database</h2>
            <thead>
               <tr>
                 <th>Title</th>
                 <th>Update</th>
                 <th>Delete</th>
               </tr>
               <tbody>
                {Posts.map((Post) => (
                    <tr key={Post.id}>
                        <td> {Post.title} </td>
                        <td> 
                            <button  className='btn btn-sm btn-info me-2 '  >Update</button>    
                            <button  className='btn btn-sm btn- me-2 '  >Delete</button>    
                         </td>
                    </tr>
                ))}
               </tbody>
            </thead>
        </div>
    );
}

export default Home;
